import "./styles.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { Menu } from "./components/Menu";
import { CreateSurvey } from "./components/CreateSurvey";
import { TakeSurvey } from "./components/TakeSurvey";
export default function App() {
  return (
    <div className="App">

      <br/>
      <hr/>
      <Router>
        <Link ><img alt="Header image" 
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSqC5qiYRJrI1UIYgCl7xpcfZNNgAdFeo2N_Q&usqp=CAU"/>
      </Link>
        <Switch>
          <Route exact path="/" component={Menu}/>
          <Route path="/createSurvey" exact><CreateSurvey ></CreateSurvey></Route>
          <Route path="/takeSurvey" component={TakeSurvey}/>
        </Switch>
      </Router>
    </div>
  );
}
